  "msg2":
      "Από το καταφύγιο Μπάφι ακολουθούμε στην αρχή και για 1000μ. τον άσφαλτο που οδηγεί στα Ραντάρ του Πολεμικού Ναυτικού, και τον αφήνουμε στη πρώτη μεγάλη στροφή. Το μονοπάτι, πολυπατημένο και φανερό (σήμανση με κίτρινο τετράγωνο), ελαφρά ανηφορικό στην αρχή, κατηφορίζει τελικά για να φτάσει στην πηγή Σκίπιζα.\nΑνηφορίζουμε κάπως απότομα προς το πυροφυλάκειο ΕΔΑΣΑ, περνάμε πίσω του και μπαίνουμε στη μεγάλη βορεινή πλαγιά. Το μονοπάτι είναι σημασμένο με {O22} και μωβ Τετράγωνο.\nΦτάνουμε στη διασταύρωση για Λυκοποριά και πηγή Μόλα και ακολουθούμε το ρέμα της Μόλας (σήμανση με κόκκινο τετράγωνο), με προορισμό την ομώνυμη πηγή.\nΣυνεχίζουμε στο ανηφορικό μονοπάτι (σήμανση με κόκκινα σημάδια) που περνά από τη μικρή Βρύση της Χαράς και μας φέρνει στον περιμετρικό άσφαλτο των κορυφών, από τον οποίο καταλήγουμε στο καταφύγιο Μπάφι.",
  "msg_explore_this_12_4_km":
      "Explore this 12.4-km point-to-point trail near Kesariani, Attica. Generally considered a challenging route, it takes an average of 4 h 55 min to complete. This is a popular trail for hiking, but you can still enjoy some solitude during quieter times of day. The trail is open year-round and is beautiful to visit anytime. From Kesariani Monastery, the route climbs up to the Mt Hymettus ridge via the very good trail \"10\". It comes out on the asphalt of the summit and at the big bend follows a dirt road and then a path that descends to Sesi and then to the Stavros col. The course passes under three caves: Strogili Cave, Tripia Cave and Mavrovouni Cave, and descends towards Terpsithea. Beautiful nature and panoramic views of various parts of the capital and the sea in the background.",
